import React,{useState} from "react"
import PropTypes, { array, object, string } from 'prop-types';
import Post from "./post";
const Myposts = () => {
    const [statepost,setStatepost] = useState([
        {   id:Date.now(),
            src:"https://nighthelper.com/wp-content/uploads/2016/03/nature_waterfall_summer_lake_trees_90400_3840x2160.jpg",
            likes:"1116",
            descr: "call me!",
        }
    ])

    const add=(value)=>{
        console.log(value)
        setStatepost([
            ...statepost,
            {   
                id:Date.now(),
                likes:"16",
                descr: "Hello! If you want to drink some delicious smoothies - just call me!",
                src:{value}
            }
        ])
    }
    const getvalue =() =>{
        console.log()
    }
return(
    <div>
        <div>
            <button onClick={add}>add</button>
        </div>
        {/* getvalue={value} */}
        
        <Post add={add}  statepost={statepost}/>
    </div>
)}
Myposts.propTypes={
    statepost : array,
}
export default Myposts
